import React from 'react';
import ReactDOM from 'react-dom';

const currenttime = new Date();
currenttime = currenttime.getTime();

ReactDOM.render(
  <>
    <div>
      <h1>{currenttime}</h1>
    </div>
  </>,
  document.getElementById("root")
);
